{"nbformat":4,"nbformat_minor":0,"metadata":{"colab":{"provenance":[],"authorship_tag":"ABX9TyOjfUomAUUn67ln8/jTuncJ"},"kernelspec":{"name":"python3","display_name":"Python 3"},"language_info":{"name":"python"}},"cells":[{"cell_type":"markdown","source":["Q1. Timing programs\n","Timing comparison and explanation"],"metadata":{"id":"sc6G9JcYikPt"}},{"cell_type":"code","execution_count":null,"metadata":{"colab":{"base_uri":"https://localhost:8080/"},"id":"vxpvopdOiULl","executionInfo":{"status":"ok","timestamp":1756382813529,"user_tz":-180,"elapsed":350,"user":{"displayName":"Nehemiah Kipchumba","userId":"09735398617109063840"}},"outputId":"b79385d2-69de-4009-b1d4-f2132ba60d10"},"outputs":[{"output_type":"stream","name":"stdout","text":["n = 1000\n","Loop Result: 500500, Time: 0.000028 seconds\n","Formula Result: 500500, Time: 0.000001 seconds\n","n = 100000\n","Loop Result: 5000050000, Time: 0.003281 seconds\n","Formula Result: 5000050000, Time: 0.000001 seconds\n","n = 10000000\n","Loop Result: 50000005000000, Time: 0.358430 seconds\n","Formula Result: 50000005000000, Time: 0.000004 seconds\n"]}],"source":["import time\n","\n","# Loop method\n","def sum_loop(n):\n","  total = 0\n","  for i in range(1, n+1):\n","    total += i\n","\n","  return total\n","\n","# Sum formula function method\n","def sum_formula(n):\n","  return n * (n + 1) // 2\n","\n","# Measure execution time\n","def measure_time(func, n):\n","  start = time.time()\n","  result = func(n)\n","  end = time.time()\n","  return result, end - start\n","\n","# n values (10**3, 10**5, 10**7)\n","n_values = [10**3, 10**5, 10**7]\n","\n","for n in n_values:\n","  loop_result, loop_time = measure_time(sum_loop, n)\n","  formula_result, formula_time = measure_time(sum_formula, n)\n","\n","  print(f\"n = {n}\")\n","  print(f\"Loop Result: {loop_result}, Time: {loop_time:.6f} seconds\")\n","  print(f\"Formula Result: {formula_result}, Time: {formula_time:.6f} seconds\")"]},{"cell_type":"code","source":["import time\n","import matplotlib.pyplot as plt\n","\n","# Loop method\n","def sum_loop(n):\n","  total = 0\n","  for i in range(1, n+1):\n","    total += i\n","\n","  return total\n","\n","# Sum formula function method\n","def sum_formula(n):\n","  return n * (n + 1) // 2\n","\n","# Measure execution time\n","def measure_time(func, n):\n","  start = time.time()\n","  result = func(n)\n","  end = time.time()\n","  return result, end - start\n","\n","# n values (10**3, 10**5, 10**7)\n","n_values = [10**3, 10**5, 10**7]\n","\n","results = []\n","for n in n_values:\n","    loop_result, loop_time = measure_time(sum_loop, n)\n","    formula_result, formula_time = measure_time(sum_formula, n)\n","    results.append((n, loop_result, loop_time, formula_result, formula_time))\n","\n","  #print(f\"n = {n}\")\n","  #print(f\"Loop Result: {loop_result}, Time: {loop_time:.6f} seconds\")\n","  #print(f\"Formula Result: {formula_result}, Time: {formula_time:.6f} seconds\")\n","\n","  # extract values for plotting\n","n_values = [result[0] for result in results]\n","loop_times = [result[2] for result in results]\n","formula_times = [result[4] for result in results]\n","\n","  # Theoretical O(n) line (scaled for visibilty)\n","theoretical_times = [n/ 1e8 for n in n_values]\n","\n","  # plotting\n","plt.figure(figsize=(8, 5))\n","plt.plot(n_values, loop_times, marker=\"o\", label=\"Loop Method (O(n))\")\n","plt.plot(n_values, formula_times, marker=\"o\", label=\"Formula Method (O(1))\")\n","plt.plot(n_values, theoretical_times, linestyle=\"--\", label=\"Theoretical O(n) Growth\")\n","\n","plt.xscale(\"log\")\n","plt.yscale(\"log\")\n","plt.xlabel(\"n (log scale)\")\n","plt.ylabel(\"Execution Time (seconds, log scale)\")\n","plt.title(\"Loop vs Formula Execution Time with Theoratical O(n)\")\n","plt.legend()\n","plt.grid(True, which=\"both\", linestyle=\"--\", linewidth=0.5)\n","plt.show()\n","\n","  # blue line - Measured loop times\n","  # orange line - Measured formula times\n","  # dashed line - theoretcal O(n) for comparison\n","\n"],"metadata":{"colab":{"base_uri":"https://localhost:8080/","height":492},"id":"wHyAAjNCtA3E","executionInfo":{"status":"ok","timestamp":1756384994442,"user_tz":-180,"elapsed":1234,"user":{"displayName":"Nehemiah Kipchumba","userId":"09735398617109063840"}},"outputId":"4b67c376-4e44-4fce-fb06-f8066ea17141"},"execution_count":null,"outputs":[{"output_type":"display_data","data":{"text/plain":["<Figure size 800x500 with 1 Axes>"],"image/png":"\n"},"metadata":{}}]},{"cell_type":"markdown","source":["Loop method - uses the complexity **O(n)**: it must add each integer one by one.\n","\n","Formula method - uses Complexity **O(1)**: it performs only a few arithmetic operations regardless of n. Execution remains constant"],"metadata":{"id":"zfNeoTjFk-31"}},{"cell_type":"markdown","source":["\n","\n","\n","\n","\n","\n","Part 2: Complexity Analysis (Lecture 22)\n","\n","Q3. Linear vs Quadratic Growth\n","\n","1. Count the number of operations for both functions"],"metadata":{"id":"sLineLkjqmaA"}},{"cell_type":"code","source":["# Count the number of operations for both functions\n","# Linear sum\n","\n","def linear_sum(L):\n","  total = 0 # 1\n","  for x in L: # n times\n","    total += x # 1\n","  return total # 1\n","\n","  # Total = n + 2 operations\n","\n","# Quadratic pairs\n","def quadratic_pairs(L):\n","  count = 0 # 1\n","  for i in L:\n","    for j in L:\n","      count += i * j # 2\n","    return count # 1\n","\n","    # Total 2n^2 + 2 operations"],"metadata":{"id":"rEszUhFtktpm"},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":["2. Runtime Growth Intuition\n","\n","Linear_sum --- grows linearly with input size.\n","\n","Quadratic_pairs --- grows quadratically as n increases\n"],"metadata":{"id":"N76998TzvRjz"}},{"cell_type":"code","source":[],"metadata":{"id":"yMLojgouvlpY"},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":["3. Plot Runtime Growth\n"],"metadata":{"id":"lUfG3l_LvyUO"}},{"cell_type":"code","source":["import time\n","import matplotlib.pyplot as plt\n","\n","# Functions\n","def linear_sum(L):\n","  total = 0\n","  for x in L:\n","    total += x\n","  return total\n","\n","\n","def quadratic_pairs(L):\n","  count = 0\n","  for i in L:\n","    for j in L:\n","      count += i * j\n","  return count\n","\n","# Input different sizes\n","sizes = [10, 100, 500, 1000, 2000]\n","linear_times = []\n","quadratic_times = []\n","\n","for n in sizes:\n","  L = list(range(n))\n","\n","  # Time linear\n","  start = time.time()\n","  linear_sum(L)\n","  end = time.time()\n","  linear_times.append(end - start)\n","\n","  # Time quadratic_pairs\n","  start = time.time()\n","  quadratic_pairs(L)\n","  end = time.time()\n","  quadratic_times.append(end - start)\n","\n","# plot\n","plt.plot(sizes, linear_times, label=\"Linear O(n)\")\n","plt.plot(sizes, quadratic_times, label=\"Quadratic O(n^2)\")\n","plt.xlabel(\"Input size (n)\")\n","plt.ylabel(\"Runtime (seconds)\")\n","plt.title(\"Linear vs Quadratic Growth\")\n","plt.legend()\n","plt.grid(True)\n","plt.show()"],"metadata":{"colab":{"base_uri":"https://localhost:8080/","height":472},"id":"nypn9lUcv4Bj","executionInfo":{"status":"ok","timestamp":1756386282903,"user_tz":-180,"elapsed":496,"user":{"displayName":"Nehemiah Kipchumba","userId":"09735398617109063840"}},"outputId":"54050813-fca2-442a-9048-c90ea1778e1a"},"execution_count":null,"outputs":[{"output_type":"display_data","data":{"text/plain":["<Figure size 640x480 with 1 Axes>"],"image/png":"\n"},"metadata":{}}]},{"cell_type":"code","source":[],"metadata":{"id":"D46CGtgxx8oY"},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":["Linear search - Checks each element one by one O(n)\n","\n","Binary search - Repeatedly halves the list O(log n)\n","\n","Python's built in operator"],"metadata":{"id":"UA_xw3i9zsti"}},{"cell_type":"code","source":["import matplotlib.pyplot as plt\n","\n","# Linear search\n","def linear_search(arr, target):\n","  operations = 0\n","  for item in arr:\n","    operations += 1\n","    if item == target:\n","      return operations # for number of operations\n","  return operations\n","\n","# Binary search\n","def binary_search(arr, target):\n","  operations = 0\n","  low = 0\n","  high = len(arr) - 1\n","\n","  while low <= high:\n","    operations += 1\n","    mid = (low + high) // 2\n","    if arr[mid] == target:\n","      return operations\n","    elif arr[mid] < target:\n","      low = mid + 1\n","    else:\n","      high = mid - 1\n","\n","  return operations\n","\n","# python operator\n","def builtin_in(arr, target):\n","  operations = 0\n","  for item in arr:\n","    operations += 1\n","    if item == target:\n","      return operations\n","  return operations\n","\n","sizes = [10**3, 10**4, 10**5, 10**6]\n","\n","linear_ops = []\n","binary_ops = []\n","builtin_ops = []\n","\n","for n in sizes:\n","  arr = list(range(n))\n","  target = n - 1\n","\n","  linear_ops.append(linear_search(arr, target))\n","  binary_ops.append(binary_search(arr, target))\n","  builtin_ops.append(builtin_in(arr, target))\n","\n","# plotting\n","plt.plot(sizes, linear_ops, 'o-', label=\"Linear Search ((n))\")\n","plt.plot(sizes, builtin_ops, 's-', label=\"Python 'in' ((n))\")\n","plt.plot(sizes, binary_ops, '^-', label=\"Binary Search ((log n))\")\n","plt.xlabel(\"List Size (n)\")\n","plt.ylabel(\"Number of Operations\")\n","plt.title(\"Search Algorithm Comparison\")\n","plt.legend()\n","plt.grid(True)\n","plt.show()"],"metadata":{"colab":{"base_uri":"https://localhost:8080/","height":472},"id":"lM1R7AG00EEQ","executionInfo":{"status":"ok","timestamp":1756388037523,"user_tz":-180,"elapsed":355,"user":{"displayName":"Nehemiah Kipchumba","userId":"09735398617109063840"}},"outputId":"15dbcc1d-7943-4477-9571-ebc1cc27fc22"},"execution_count":null,"outputs":[{"output_type":"display_data","data":{"text/plain":["<Figure size 640x480 with 1 Axes>"],"image/png":"\n"},"metadata":{}}]},{"cell_type":"markdown","source":["Applied analysis\n","\n","Q5. Matrix Multiplication\n","Write a function to multiply two nn matrices.\n","Count the number of operations.\n","Express the complexity in Big-O and Big-Theta notation.\n","Hint: Nested loops matter!"],"metadata":{"id":"N66LIWd05DMD"}},{"cell_type":"code","source":["def matrix_multiply(A, B):\n","  n = len(A)\n","  C = [[0] * n for _ in range(n)]\n","\n","  operations = 0 #\n","\n","  # nested loops\n","  for i in range(n):\n","    for j in range(n):\n","      for k in range(n):\n","        C[i][j] += A[i][k] * B[k][j]\n","        operations += 2 # multiplication and addition\n","\n","  return C, operations\n","\n","A = [[1, 2], [3, 4]]\n","B = [[5, 4], [7, 8]]\n","C, ops = matrix_multiply(A, B)\n","print(\"Result:\", C)\n","print(\"Operations:\", ops)\n","\n","# complexity analysis\n","# complexity = O(n^3), O(log n^3)\n","# operations = 2n^3\n","# uses 3 nested loops"],"metadata":{"colab":{"base_uri":"https://localhost:8080/"},"id":"OLUd-hbQ4pCy","executionInfo":{"status":"ok","timestamp":1756389591771,"user_tz":-180,"elapsed":63,"user":{"displayName":"Nehemiah Kipchumba","userId":"09735398617109063840"}},"outputId":"656019f5-6011-49df-a2f3-78112a2afc22"},"execution_count":null,"outputs":[{"output_type":"stream","name":"stdout","text":["Result: [[19, 20], [43, 44]]\n","Operations: 16\n"]}]},{"cell_type":"code","source":[],"metadata":{"id":"ZxBZ81F1962n"},"execution_count":null,"outputs":[]}]}